import { AppPhoneIcon } from './Icons/AppPhoneIcon'
import { AppLink } from './Icons/AppLink';


export const AppPhone = ({ phone }) => (
  <AppLink href={ `${ phone }` }>
    <AppPhoneIcon

    />
    { phone }
  </AppLink>
)
